import { useContext } from "react";
import { UserContext } from "../context";


function Teacher11() {
  const teacher = useContext(UserContext);
  console.log(teacher[10]);
  return (
    <div>
      <div>{teacher[10].name}</div>
      <img id='base64image'
       src={'data:image/jpeg;base64,' + teacher[10].image}
       style={{"width": "200px"}}
        />
      <div>{teacher[10].instrument}</div>
      <div>{teacher[10].introduction}</div>
    </div>
  );
};

export default Teacher11;
